def max_ahmes_expression_value(expression, plus_count, minus_count):
    def evaluate_expression(expression):
        if expression.isdigit():
            return int(expression)

        stack = []
        i = 0
        while i < len(expression):
            if expression[i] == '(':
                stack.append('(')
            elif expression[i].isdigit() and (i == 0 or expression[i-1] in ['+', '-']):
                end = i
                while end < len(expression) and expression[end].isdigit():
                    end += 1
                stack.append(int(expression[i:end]))
                i = end - 1
            elif expression[i] in ['+', '-']:
                stack.append(expression[i])
            elif expression[i] == ')':
                num2 = stack.pop()
                op = stack.pop()
                num1 = stack.pop()
                if op == '+':
                    stack.append(num1 + num2)
                elif op == '-':
                    stack.append(num1 - num2)
            i += 1

        return stack[0]

    max_val = evaluate_expression(expression.replace('?', '+'))
    for i in range(1, plus_count+1):
        val = evaluate_expression(expression.replace('?'*i, '+') )
        if val > max_val:
            max_val = val
    for i in range(1, minus_count+1):
        val = evaluate_expression(expression.replace('?'*i, '-') )
        if val > max_val:
            max_val = val

    return max_val
```

