def compare_fractions(a, b, n, cf):
    def continued_fraction_to_fraction(cf):
        fraction = cf[-1]
        for i in range(len(cf) - 2, -1, -1):
            fraction = cf[i] + 1 / fraction
        return fraction

    def gcd(x, y):
        while y:
            x, y = y, x % y
        return x

    def reduce_fraction(num, den):
        common_divisor = gcd(num, den)
        return num // common_divisor, den // common_divisor

    fraction1 = a / b
    fraction2 = continued_fraction_to_fraction(cf)
    fraction2_num, fraction2_den = fraction2.as_integer_ratio()
    reduced_fraction2 = reduce_fraction(fraction2_num, fraction2_den)

    if fraction1 == reduced_fraction2:
        return "YES"
    else:
        return "NO"
