def nthMagicalNumber(N, A, B):
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def lcm(a, b):
        return a * b // gcd(a, b)

    MOD = 10**9 + 7
    LCM = lcm(A, B)

    left = 1
    right = min(A, B) * N

    while left < right:
        mid = (left + right) // 2
        count = mid // A + mid // B - mid // LCM

        if count < N:
            left = mid + 1
        else:
            right = mid

    return left % MOD
