    one_repeat, two_repeat = 0, 0
    p = 2
    while p < len(s):
        if s[p] == s[p-1] == s[p-2]:
            length = 2
            while p < len(s) and s[p] == s[p-1]:
                length += 1
                p += 1

            total_changes += length // 3
            if length % 3 == 0:
                one_repeat += 1
            elif length % 3 == 1:
                two_repeat += 1
        else:
            p += 1

    if len(s) < 6:
        return max(missing_type, 6 - len(s))
    elif len(s) <= 20:
