    dp[0][k*t] = 1

    for i in range(1, t+1):
        for j in range(2 * k * t + 1):
            for d in range(-k, k+1):
                if 0 <= j + d < 2 * k * t + 1:
                    dp[i][j] += dp[i-1][j+d]
                    dp[i][j] %= MOD

    result = 0
    for i in range(k*t+1, 2*k*t+1):
        for j in range(b-a+1):
            result += dp[t][i] * dp[t][i-j]
            result %= MOD

    return result

