def kSimilarity(A, B):
    def neighbors(s):
        for i, c in enumerate(s):
            if c != B[i]:
                break
        for j in range(i+1, len(s)):
            if s[j] == B[i]:
                yield s[:i] + s[j] + s[i+1:j] + c + s[j+1:]

    queue = [(A, 0)]
    visited = set([A])

    while queue:
        s, k = queue.pop(0)
        if s == B:
            return k

        for nei in neighbors(s):
            if nei not in visited:
                visited.add(nei)
                queue.append((nei, k+1))

    return -1
