def count_regular_bracket_sequences(n, s):
    MOD = 10**9 + 7
    open_count = 0
    for c in s:
        if c == '(':
            open_count += 1

    if open_count > n or (n - open_count) % 2 == 1:
        return 0

    dp = [[0] * (2*n+1) for _ in range(2*n+1)]
    dp[0][0] = 1

    for i in range(2*n):
        for j in range(2*n):
            if dp[i][j] == 0:
                continue

            if j + 1 < 2*n:
                dp[i+1][j+1] += dp[i][j]
                dp[i+1][j+1] %= MOD

            if j > 0:
                dp[i+1][j-1] += dp[i][j]
                dp[i+1][j-1] %= MOD

            if i + 1 < 2*n:
                dp[i+1][j] += dp[i][j]
                dp[i+1][j] %= MOD

    return dp[2*n][open_count]

