def rearrange_sequence(n, sequence):
    seen = set()
    mapping = {}
    for num in sequence:
        mapping[num] = True

    result = []
    for num in sequence:
        if num in seen:
            continue
        seen.add(num)
        result.append(num)
        current = num
        while current in mapping:
            if current % 3 == 0 and current // 3 in mapping:
                current //= 3
            elif current * 2 in mapping:
                current *= 2
            else:
                break
            seen.add(current)
            result.append(current)

    return result
