def find_zigzag_intervals(trees):
    intervals = []
    for i in range(len(trees)-2):
        if (trees[i][0] < trees[i+1][0] > trees[i+2][0]) or (trees[i][0] > trees[i+1][0] < trees[i+2][0]):
