            end = i + 2
            while end+1 < len(trees) and ((trees[end][0] < trees[end+1][0] > trees[end+2][0]) or (trees[end][0] > trees[end+1][0] < trees[end+2][0])):
                end += 2
            intervals.append((start, end))
    if len(intervals) == 0:
        return []
    final_intervals = [(intervals[0][0], intervals[0][1])]
    for i in range(1, len(intervals)):
        if intervals[i][0] > final_intervals[-1][1]:
            final_intervals.append((intervals[i][0], intervals[i][1]))
