def find_f1_eq_f2(n, k):
    def f1(n, k):
        i = 1
        while True:
            multiple = n * i
            if all(int(d) < k for d in str(multiple)):
                return multiple
            i += 1

    def f2(n, k):
        i = 1
        while True:
            multiple = n * i
            if set(str(multiple)) == set(map(str, range(k))):
                return multiple
            i += 1

    forgiving_n = n
    f1_n = f1(n, k)
    f2_n = f2(n, k)

    if f1_n == f2_n:
        forgiving_n += 1

    while f1(forgiving_n, k) != f2(forgiving_n, k):
        forgiving_n += 1

    return forgiving_n

