            for x, y in [(0, 1), (0, -1), (1, 0), (-1, 0)]:
                dfs(i + x, j + y)

        components = 0
        visited = [[False for _ in range(m)] for _ in range(n)]
        for i in range(n):
            for j in range(m):
                if not visited[i][j] and grid[i][j] == value:
                    component = []
                    dfs(i, j)
                    if len(component) > 0:
                        components += 1
        return components

    min_changes = n * m
    for target in [0, 1]:
        for changes in range(k + 1):
            changes_needed = 0
            for row in table:
                changes_needed += min(sum(x != target for x in row), len(row) - sum(row))
            if changes >= changes_needed and (changes - changes_needed) % 2 == 0:
                valid_components = count_components(table, target)
                if valid_components == 1 or (valid_components == 2 and (k - changes) >= 2):
                    min_changes = min(min_changes, changes)

    return -1 if min_changes == n * m else min_changes

```

