def min_cells_to_black_square(n, m, painting):
    row_sum = [0] * n
    col_sum = [0] * m
    total_black = 0
    left_top = None
    right_bottom = None

    for i in range(n):
        for j in range(m):
            if painting[i][j] == 'B':
                total_black += 1
                row_sum[i] += 1
                col_sum[j] += 1
                if left_top is None:
                    left_top = (i, j)
                right_bottom = (i, j)

    if total_black == 0:
        return -1

    max_side_len = max(right_bottom[0] - left_top[0] + 1, right_bottom[1] - left_top[1] + 1)

    side_black = 0
    if max_side_len == right_bottom[0] - left_top[0] + 1:
        for k in range(left_top[1], right_bottom[1] + 1):
            if painting[left_top[0]][k] != 'B':
                side_black += 1
    else:
        for k in range(left_top[0], right_bottom[0] + 1):
            if painting[k][left_top[1]] != 'B':
                side_black += 1

    return total_black - (max_side_len**2) + side_black
```

