def num_primorial(n):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    result = 1
    count = 0
    num = 2
    while count < n:
        if is_prime(num):
            result *= num
            count += 1
        num += 1
    return result
