def longest_subarray_not_divisible(n, x, a):
    prefix_sum = [0]
    for num in a:
        prefix_sum.append((prefix_sum[-1] + num) % x)

    if prefix_sum[-1] != 0:
        return n

    min_index = {0: -1}
    max_length = 0
    for i, num in enumerate(prefix_sum):
        if num in min_index:
            max_length = max(max_length, i - min_index[num])
        else:
            min_index[num] = i

    return max_length if max_length > 0 else -1
```

