def count_intersecting_wire_pairs(points):
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def count(p1, p2):
        dx = p1[0] - p2[0]
        dy = p1[1] - p2[1]
        return gcd(abs(dx), abs(dy)) - 1

    intersecting_pairs = 0
    n = len(points)
    for i in range(n):
        for j in range(i+1, n):
            intersecting_pairs += count(points[i], points[j])

    return intersecting_pairs
```

