def count_pipe_ways(n, m, city):
    def is_valid(x, y):
        return 0 <= x < n and 0 <= y < m

    def dfs(x, y, turns):
        if x == -1 or y == -1 or x == n or y == m or city[x][y] == '#':
            return 0

        if x == 0 or y == 0 or x == n - 1 or y == m - 1:
            return 1 if turns == 2 else 0

        ways = 0
        city[x] = city[x][:y] + '#' + city[x][y + 1:]
        ways += dfs(x+1, y, turns + 1) + dfs(x-1, y, turns + 1) + dfs(x, y+1, turns + 1) + dfs(x, y-1, turns + 1)
        city[x] = city[x][:y] + '.' + city[x][y + 1:]

        return ways

    res = 0
    for i in range(1, n - 1):
        for j in range(1, m - 1):
            res += dfs(i, j, 0)

    return res
```

